public static void printDistanceMatrix(double[][] distanceMatrix) throws IOException {
    // BufferedWriter out = new BufferedWriter(new
    // FileWriter("C:\\Documents and Settings\\Marios Fokaefs\\Desktop\\wikidev-files\\ucosp\\clusters"+week+".txt"));
    BufferedWriter out = new BufferedWriter(new FileWriter("C:\\Documents and Settings\\Marios Fokaefs\\Desktop\\wikidev-files\\c301f09\\distances.txt"));
    for (int i = 0; i < distanceMatrix.length; i++) {
        for (int j = 0; j < distanceMatrix.length; j++) {
            out.write(distanceMatrix[i][j] + "\t");
        }
        out.newLine();
    }
    out.close();
}
